import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Vol_Data() {
  const [srno, setSrno] = useState('');
  const [volunteerData, setVolunteerData] = useState(null);

  const handleFormSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:3001/get-volunteer', { srno });
      setVolunteerData(response.data);
    } catch (error) {
      console.error('Error fetching volunteer data:', error);
    }
  };

  return (
    <div>
      <h1 id="title">Volunteer Information</h1>
      <form className="form" onSubmit={handleFormSubmit}>
        <label htmlFor="srno">Enter Serial Number:</label>
        <input
          type="text"
          id="srno"
          name="srno"
          required
          value={srno}
          onChange={(e) => setSrno(e.target.value)}
        />
        <button type="submit" id="btn">Submit</button>
      </form>

      {volunteerData && (
        <div>
          <table border="1">
            <thead>
              <tr>
                <th>Serial Number</th>
                <th>Name</th>
                <th>VEC Number</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>{volunteerData.volunteerData.srno}</td>
                <td>{volunteerData.volunteerData.name}</td>
                <td>{volunteerData.volunteerData.vecno}</td>
              </tr>
            </tbody>
          </table>

          {volunteerData.volunteerData.eventsattained && volunteerData.volunteerData.eventsattained.length > 0 && (
            <div>
              <h2>Events Attained</h2>
              {getTablesByEventCategory(volunteerData.volunteerData.eventsattained)}
            </div>
          )}
        </div>
      )}
    </div>
  );
}

function getTablesByEventCategory(events) {
  // Group events by event category
  const eventsByCategory = events.reduce((acc, event) => {
    const category = event.eventcategory;
    if (!acc[category]) {
      acc[category] = [];
    }
    acc[category].push(event);
    return acc;
  }, {});

  return Object.entries(eventsByCategory).map(([category, events]) => (
    <div key={category}>
      <h3>{category}</h3>
      <table border="1">
        <thead>
          <tr>
            <th>Event Name</th>
            <th>Date</th>
            <th>Hours Allotted</th>
          </tr>
        </thead>
        <tbody>
          {events.map((event) => (
            <tr key={event._id}>
              <td>{event.eventname}</td>
              <td>{event.date ? new Date(event.date).toLocaleDateString() : 'No Date Available'}</td>
              <td>{parseInt(event.hoursalloted, 10) || 0}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  ));
}

export default Vol_Data;
